import ExpenseItem from "./components/ExpenseItem";

function App() {
  const dataVal = [
    { id: "i1", title: "Ipad", amount: 850, date: new Date(2022, 11, 10) },
    { id: "i2", title: "Ipad", amount: 850, date: new Date(2022, 11, 10) },
    { id: "i3", title: "Ipad", amount: 850, date: new Date(2022, 11, 10) },
    { id: "i4", title: "Ipad", amount: 850, date: new Date(2022, 11, 10) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={dataVal[0].title}
        amount={dataVal[0].amount}
        date={dataVal[0].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
